  false,\n\t\"url\": null,\n\t\"notes\": \"The National Marine Mammal Laboratory conducted
  aerial surveys to monitor the abundance and distribution of beluga whales in Cook
  Inlet, Alaska. This database contains the counts of beluga whale groups made by
  the aerial observers during surveys from 1993-2012, and 2014. There were no surveys
  in 2013. Counts occurred concurrent with video collection during each pass near
  a beluga group.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
